// src/pages/WelcomePage.js
import React from 'react';
import { Link } from 'react-router-dom';

const WelcomePage = () => {
  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gradient-to-br from-blue-100 to-purple-200 text-center">
      <h1 className="text-4xl font-bold mb-8">Welcome to FocusMate</h1>
      <div className="space-y-4">
        <Link to="/focus">
          <button className="px-6 py-2 bg-blue-500 text-white rounded-xl hover:bg-blue-600 transition">Start Focus Mode</button>
        </Link>
        <Link to="/distraction">
          <button className="px-6 py-2 bg-purple-500 text-white rounded-xl hover:bg-purple-600 transition">Distraction Check</button>
        </Link>
        <Link to="/analytics">
          <button className="px-6 py-2 bg-green-500 text-white rounded-xl hover:bg-green-600 transition">Analytics</button>
        </Link>
        <Link to="/settings">
          <button className="px-6 py-2 bg-gray-600 text-white rounded-xl hover:bg-gray-700 transition">Settings</button>
        </Link>
      </div>
    </div>
  );
};

export default WelcomePage;
